import Box from "../Box/Box"
import { useSelector } from "react-redux"
import './catalogo.css'


function Catalogo(){

    const boxs = useSelector((state) => state.box);

    return(
        <div>
            <div class="conteiner ">
                <div class="row g-5 p-5 " id="estrutura">
                    {boxs.map((struct) => <Box produto={struct}/>)}
                </div>       
            </div>
        </div>
    )
}

export default Catalogo
